import React from "react";

const LibrarySongs = ({ song }) => {
  const songType = () => {
    if (song.type === "Melodic Dubstep" || song.type === "EDM") {
      return <p style={{ background: "#4361ee" }}>#{song.type}</p>;
    }
    if (song.type === "Electronic" || song.type === "Chill") {
      return <p style={{ background: "#7b2cbf" }}>#{song.type}</p>;
    }
    if (song.type === "Future House" || song.type === "House") {
      return (
        <p style={{ background: "#ffbc42", color: "#333" }}>#{song.type}</p>
      );
    }
    return <p>#{song.type}</p>;
  };
  return (
    <div className="card">
      <img src={song.cover} alt={song.name} />
      <div className="content">
        <h3>{song.name}</h3>
        <p>{song.artist}</p>
        <p>{song.type}</p>
      </div>
    </div>
  );
};

export default LibrarySongs;
